import React from "react";
class App extends React.Component{
    constructor(props){
    super(props)
    this.state={
        id:1,
        book:"hari",
        author:"krishna",
    }
    }
    render(){
    return(
  
        
    <div> 
        <h3>constructor method</h3>
        <p>
           id:{this.state.id}<br></br>
           bookname:{this.state.book}<br></br>
           author:{this.state.author}<br></br>
           </p>
    </div>


    )

    }
    
}

export default App;
